function New() {
  return (
    <div className="">
      <form action="" method="post">
        <button
          type="submit"
          className="bg-[#D6DEE8] text-white text-xl h-10 w-30 rounded-sm
          hover:bg-[#4D6BFE] hover:cursor-pointer hover:duration-300 hover:ease-out"
        >
          New chat
        </button>
      </form>
    </div>
  );
}

export default New;
